import logo from './logo.svg';
import React from 'react';
import './App.css';

function App() {

  const [employeeList, setEmployeeList] = React.useState(null);

  React.useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((employeeList) => {
        setEmployeeList(employeeList)
        console.log(employeeList[0]['first_name'])
      }
        );
  }, []);

  return (
    <div className="App">
      <table className="employee-table">
        <tr>
          <th>Check Box</th>
          <th>Customer ID</th>
          <th>First Name</th>
          <th>Last Name</th>
        </tr>

      { employeeList ?
        employeeList.map( obj => <p>{obj.first_name} {obj.last_name}</p>) :
        <p>loading....</p>
      }
      </table>
    </div>
  );
}

export default App;
